INSERT INTO `article_contents` VALUES (1,1,'<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The Law Commission in its 279th report stated that Section 124A needs to be retained in the Indian Penal Code (IPC) through certain amendments.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Recommendations on Sedition</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Sedition being a colonial law not a valid ground for its repeal.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It should be made punishable with life imprisonment or for a term up to 7 years or with a fine.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">FIR be filed only after preliminary inquiry and permission from the government by amending Section 154 of the Code of Criminal Procedure.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Amend Section 124A to align with Kedar Nath&rsquo;s Case (1962) which underlines the presence of a tendency to incite violence as a precondition to invoke the clause.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">IPC defines sedition as offense: bringing hatred/contempt, exciting disaffection towards the established government by law by:</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">words, either spoken or written.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">signs.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">visible representation, or otherwise.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Sedition is a cognizable, non-bailable, and non-compoundable offenses, entailing life imprisonment as maximum punishment, with or without a fine.</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong id=\"docs-internal-guid-0395595e-7fff-faed-00d7-e76a1639ed5c\">In May 2022 (SG Vombatkere vs UOI), SC had held that sedition law should be effectively kept in abeyance till the Union government reconsiders the provision.</strong></p>','2024-01-02 12:52:31','2024-01-02 13:12:24'),(2,2,'<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The Department of Personnel and Training (DoPT) has asked the Union Public Service Commission (UPSC) to induct these senior officers from the private sector.</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Lateral entry is referred to as the appointment of private sector specialists in government departments.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">&nbsp;This is the 4th such lateral entry initiative since it was introduced in 2018.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Idea has been advocated by Surinder Nath Committee (2003), Hota Committee (2004) and Second ARC (2008).</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">NITI Aayog, in its three-year Action Agenda (2017&mdash;2020), recommended the induction of personnel at middle and senior management levels in the central government.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Arguments in favour:</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Twin objective of bringing in fresh talent as well as augment the availability of manpower.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Domain expertise synthesised with the multi-sectoral wisdom of the permanent civil service may help in producing a better output.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Increasing complexity in governance due to factors like digitalization of governance, financial frauds, cybercrime.</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">It will increase efficiency by imparting competition within the governance.</p>\n</li>\n</ul>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Arguments against:</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Difficulty in adjusting to the bureaucratic work culture.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Short tenures are not conducive to hold accountability.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Lack of field experience.</p>\n</li>\n</ul>\n</ul>\n<p>&nbsp;</p>','2024-01-02 13:30:32','2024-01-02 13:30:32'),(3,3,'<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">South Africa is thinking about legal options if Russian President, the subject of a war crimes arrest warrant issued by the ICC, did attend the BRICS summit.</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">As a member of the ICC, South Africa would theoretically be required to arrest Russian President if he attended.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">States Parties to the Rome Statute have a legal obligation to cooperate.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">About ICC (HQ- Hague, Netherlands)</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It is an international court to investigate and prosecute individuals accused of serious international crimes: genocide, crimes against humanity, war crimes, and aggression.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It was established by the Rome Statute of the International Criminal Court in 1998.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It has jurisdiction only over crimes committed after July 1, 2002, when the Rome Statute entered into force.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">The Court does not have its own police force. Accordingly, it relies on State cooperation, which is essential to the arrest and surrender of suspects.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">There are 123 countries party to the Rome Statute.</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Countries that never signed the treaty: India, China, Iraq, North Korea, Saudi Arabia, Turkey, etc</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Countries signed but not ratified the treaty: Egypt, Iran, Israel, Russia, the United States, etc.</p>\n</li>\n</ul>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Sources of Cases before the court:</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Member country can refer situation within its territory to the court.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">UN Security Council can refer to a situation- in this all-UN Member States must cooperate regardless of party status.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Prosecutor can initiate an investigation into member state.</p>\n</li>\n</ul>\n</ul>\n<p>&nbsp;</p>','2024-01-02 13:34:33','2024-01-02 13:34:33'),(4,4,'<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Both sides highlighted that the India-Nepal Treaty of Peace and Friendship of 1950 forms the basis of relations between the two countries.</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">The treaty talks about the common treatment of Indian and Nepali citizens in the two countries: residence, property, business, and movement.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Key Highlights&nbsp;</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\"><strong>Infrastructure:</strong></p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Agreements between NHPC and VUCL (Vidyut Utpadan Company Ltd), Nepal, for the development of the Phukot Karnali Hydroelectric Project.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Project Development Agreement for the Lower Arun Hydroelectric Project between SJVN (India) and the Investment Board of Nepal.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">India set a target of importing 10,000 MW of electricity from Nepal.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Phase-II facilities under Motihari-Amlekhgunj Petroleum Pipeline.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\"><strong>Connectivity:</strong></p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">35-km cross-border railway line linking Jaynagar in Bihar to Kurtha in Nepal.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Signed the Revised Transit Agreement (1992) that will help Nepal access to India&rsquo;s inland waterways.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Inaugurated the Indian Railway cargo train from Bathnaha in India to Nepal Customs Yard.&nbsp;</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\"><strong>Others</strong></p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Nepal signed a framework to join the India-led International Solar Alliance.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">To set up a fertilizer plant in Nepal.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"3\">\n<p dir=\"ltr\" role=\"presentation\">Integrated Check posts at Rupaidiha in India and Nepalgunj in Nepal.</p>\n</li>\n</ul>\n</ul>\n</ul>','2024-01-02 13:49:08','2024-01-02 13:49:08'),(5,5,'<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">European Union, Chinese Taipei, and Japan in raised the issue that India violated its zero-tariff commitment under the Information Technology Agreement (ITA) under the multilateral trade body.</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">India, which is a signatory to the 1996 ITA, is required to eliminate tariffs on a range of products, including mobile handsets.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">However, India claimed that at the time of signing the ITA, products such as smartphones did not exist, and hence, not bound to eliminate tariffs on such items.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">About ITA<img src=\"https://lh7-us.googleusercontent.com/FxRY7CUAPpnUiX_ujOsOwjbQaDfG9QtxUpX0Cz7jIrJemTEMsUeJWeZIAKGJ1P6HhfPq2L8uC2qBLYsWn2dkP4CXNSkrp7zPgITB8eiV3w7Qcnpa2Kb1Zq6GWQOeo9SI1kBkq8W4Og8NRWux3YV39w\" width=\"706\" height=\"195\"></p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It is a plurilateral agreement of the WTO.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It covers a large number of high-technology products, including computers, telecommunication equipment, semiconductors, semiconductor manufacturing, etc.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">It covers 81 WTO members, which account for approximately 97 percent of world trade in information technology products.</p>\n</li>\n</ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Dispute resolution in WTO&nbsp;</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">There are two main ways to settle a dispute once a complaint has been filed in WTO:</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Parties find a mutually agreed solution, particularly during the phase of bilateral consultations.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Through adjudication, including the subsequent implementation of the panel and Appellate Body reports.</p>\n</li>\n</ul>\n</ul>\n<p>&nbsp;</p>','2024-01-02 14:03:46','2024-01-02 14:16:32'),(6,6,'<h1 dir=\"ltr\">Introduction</h1>\n<p dir=\"ltr\">Corruption has been a pervasive and deeply entrenched issue in India which has prevailed from time immemorial in one form or the other. This pervasive problem touches every facet of public life and governance and poses a significant obstacle to India\'s progress, undermining its institutions, eroding trust, and hindering socio-economic development. Since Independence, India has made large strides in the fight against corruption. However, as per Corruption Perceptions Index 2022, India ranks at 85th among 180 countries. As such, India still has a long way from being a corruption free country.</p>\n<ol>\n<li dir=\"ltr\" aria-level=\"1\">\n<h1 dir=\"ltr\" role=\"presentation\">What does the term \"corruption\" mean and to what extent it prevails in India?</h1>\n</li>\n</ol>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The word \"corrupt\" is derived from the Latin word \"corruptus\" which means to abuse or destroy. Corruption is a global phenomenon and is defined as misuse of public position or power for personal gains. As per United Nations Development Programme,&nbsp;</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<p dir=\"ltr\">Corruption = (monopoly + discretion) &minus; (accountability + integrity + transparency)</p>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">There are different forms of corruption including bribery, embezzlement, extortion, networking, under-the-table transactions, manipulation of the election result, money laundering, and more.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">According to the latest Corruption Perceptions Index by Transparency International (TI), India has one of the highest incidences of bribery and use of personal connections to access key public services such as health and education.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">While the country&rsquo;s score has remained stagnant over the past decade, some of the mechanisms that could help reign in corruption are weakening.&nbsp;</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<ol>\n<li dir=\"ltr\" aria-level=\"2\">\n<h2 dir=\"ltr\" role=\"presentation\">What are the different forms of corruption?&nbsp;</h2>\n</li>\n</ol>\n<p><strong>&nbsp;</strong></p>\n<p dir=\"ltr\">&nbsp;</p>\n<p><strong>&nbsp;</strong></p>\n<ol start=\"2\">\n<li dir=\"ltr\" aria-level=\"2\">\n<h2 dir=\"ltr\" role=\"presentation\">What are the root causes that sustain corruption in India?</h2>\n</li>\n</ol>\n<p dir=\"ltr\">The root causes of corruption are multifaceted and complex, spanning structural, societal, and political factors. These factors shape the individual reasoning leading to corrupt practices among individuals both in public and private sector and thereby contributing to the continuing presence of corruption in the country.</p>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Institutional Factors</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Systemic issues: The process of decision making coupled with discretion, official secrecy, rigid bureaucratic structures and processes breeds corruption. Lack of public action and absence of a strong public forum to oppose corruption allows it to reign in the country.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">For example- Major corruption cases like Bofors scam, 1986, Fodder scam,1996 and Telgi\'s counterfeit stamp paper scam, 2002 exploited bureaucratic inefficiencies, a lack of transparency and oversight mechanism.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Elections: During election time, corruption is at its peak to meet high cost of election and to seek personal favour. Bribery to politicians buys influences and bribery by politicians buys votes.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">In Cash for Votes Scandal, 2008, during a trust vote in the Lok Sabha, several MPs were caught on camera accepting cash in exchange for their votes.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Public procurement: According to World Bank estimate, the average bribe to obtain a public contract in India is estimated at 15% of the contract value.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of Independent agency: The existing agencies for example CBI are under the control of either the government or the bureaucrats are not free to investigate corruption cases.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Norms and Values</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of values: Focus on rote learning and lack of emphasis on value education can breed dishonesty and corruption.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Social Acceptance: Over the years, social stigma attached to corruption has reduced and there is now growing social acceptance and tolerance for corruption.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Collective action problem</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Low remuneration: Below average or low remuneration in a highly inflationary economy drive government officials to use unlawful and illegal means of deriving income.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Instances of bribery and corruption among police officers are often attributed to inadequate salaries.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Competition: The competition in the market with respect to power, position, jobs, and education keeps the bug of corruption alive in society.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Functional issues</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Poor implementation: There exists strong governance structure, oversight institutions (CVC, CAG etc.), legal framework (Prevention of corruption Act) and policies in India. However, there is a huge gap between the policies and practice.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The 2010 Commonwealth Games scam exposed poor oversight and implementation of anti-corruption measures within the organizing committee.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Opaque System: Lack of access to information publicly hampers scrutiny, accountability and it becomes easier for corruption to occur behind closed doors.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The public distribution system (PDS) is vulnerable to corruption when beneficiaries lack access to information about their entitlements and supplies.</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 1.1. Root causes shaping individual reasoning for corruption</p>\n<p dir=\"ltr\"><img src=\"https://lh7-us.googleusercontent.com/HFku9pnDuZrv5ynbDx0jcvb67q6JKxDq5yXUcIgnZ1yT4pkx-UFU2YHXZoog0eBKBid7UFYhZ1ueTnP02gQnxMQ-wyY62AZJlS41t5O1xlycdvYDbPBHBXrisBFaxxXrBbGKmdl9iB5QoWbFlajVBQ\" alt=\"A screenshot of a white box with black text\n\nDescription automatically generated\" width=\"611\" height=\"336\"></p>\n<br><br></td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<h1 dir=\"ltr\">2. What are the implications of widespread corruption for India\'s development and progress?</h1>\n<p dir=\"ltr\">There are significant impacts of corruption in society, spanning across social, economic, political and environmental dimensions.</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Economic cost</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Reduced economic growth: Corruption promotes inefficiencies in utilisation of resources, distorts the markets, compromises quality which adversely affects the country&rsquo;s economic development.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Estimates show that in India, government loses about Rs. 2 lakh crores annually due to tax evasion while about Rs. 40,000 crores is lost due to delay in projects.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Unfavourable business environment: High levels of corruption can discourage foreign and domestic investments.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Social cost</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Erosion of Public Trust: Corruption leads to a loss of public trust in government and undermines the credibility of government institutions.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">For instance, alleged corruption cases like 2G Spectrum Scam, 2007 and Coal Scam or Coalgate, 2012 played against the incumbent government.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Access to Services: Corruption can hinder access to essential services like healthcare, education, and clean water, particularly for vulnerable populations.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Corruption in healthcare was seen during COVID-19 as embezzlement of health care funds, using expired vaccines, fraudulent health contracts, etc.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Exacerbating Poverty: Corruption leads to poor re-distribution of wealth thus supplements poverty and inequality.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Freedom of Speech: Corruption can hamper the freedom of speech provided under Article 19. Collusion among the media house, politicians, lobbyists can lead to dissemination of fake news, augment paid news culture and hamper free and fair news coverage.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Human Rights: Corruption decreases public trust in justice and weakens the capacity of judicial systems to guarantee the protection of human rights,</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Gender inequality: Corruption restricts women\'s access to opportunities and public resources. It disproportionately affecting those with less power, often through gender-specific forms like sexual bribery, perpetuating social, cultural, and political discrimination.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">As per Transparency International study, number of mothers dying during childbirth increases exponentially in countries where there is a higher incidence of bribery.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Political cost</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Undermine principles of democracy: Corruption distorts political processes, and influences election outcomes.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Impaired Rule of Law: Corruption can lead to selective enforcement of laws and a lack of accountability for those in power.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Environmental cost: Corrupt officials may grant permits to illegal environmental activities, such as poaching, illegal logging, or toxic waste dumping.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">For instance, illegal rhino horn trade persists due to corruption among officials and dealers.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Implications for National Security</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Links between Organized crime and corruption: Corruption supports the ongoing existence of organized crime. Criminal, bureaucrat and political nexus can support illegal activities such as money laundering, drug trafficking, kidnapping etc.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Conflict and social unrest: Corruption leads to unequal distribution of resources and opportunities and thereby creates conditions in which conflict is more likely to occur&nbsp;by fostering division between different groups and eating away at the rule of law.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">It also make a country vulnerable to undue influence from foreign actors.</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 2.1. Corruption: Ethical or Unethical?</p>\n<p dir=\"ltr\">An ethical act is one that is generally thought of as an act that society has not deemed &ldquo;wrong&rdquo;. Ethical principles, such as fairness, justice, and common good, often conflict with corrupt behavior. However, whether corruption can ever be ethically permissible depends on the ethical framework one uses and the specific circumstances under consideration.</p>\n<br>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Deontolological and consequentialism theory: Deontology (associated with philosopher Immanuel Kant) is an ethical theory that uses rules to distinguish right from wrong. It requires that people follow the rules and do their duty. Whereas, consequentialism is the view that actions are determined to be right or wrong based on consequences.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Corruption can be considered ethically permissible under Kant&rsquo;s theories if the actor acts out of duty and not a motive that alleviates guilt or results in self-gratification.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Virtue ethics: It emphasizes the role of character and virtue in moral philosophy rather than either doing one&rsquo;s duty or acting in order to bring about good consequences. Most virtue ethics theories take their inspiration from Aristotle who declared that a virtuous person is someone who has ideal character traits.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">As per Virtue ethics, one must expose corruption as it defends virtues and protects the good life by demonstrating a commitment to values such as honesty and truth. Thus, corruption is not permissible as per Virtue Ethics.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong><br><br></strong></p>\n<h1 dir=\"ltr\">3. What is India doing to prevent and combat corruption within its systems and institutions?</h1>\n<p dir=\"ltr\">Given the magnitude and pernicious nature of corruption affecting every aspect of society and economy, various concerted efforts have been made to reduce level of corruption.</p>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"255\"><col width=\"435\"></colgroup>\n<tbody>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Table 3.1. India&rsquo;s efforts to prevent and combat corruption</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Regulatory framework</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Lokpal and Lokayuktas Act, 2013</p>\n</td>\n<td>\n<p dir=\"ltr\">Establishment of a body of Lokpal for the Union and Lokayukta for States to inquire into allegations of corruption against certain public functionaries including Prime Minister and other Union Ministers, Member of Parliament, and others.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Central Vigilance Commission (CVC)</p>\n</td>\n<td>\n<p dir=\"ltr\">It aims to bring about transparency, fair-play, objectivity, accountability and responsiveness in public administration.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Central Bureau of Investigation (CBI), Ministry of Personnel, Pension &amp; Public Grievances</p>\n</td>\n<td>\n<p dir=\"ltr\">It is the premier investigating police agency for combating corruption in public life.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Directorate of Enforcement (ED), Ministry of Finance</p>\n</td>\n<td>\n<p dir=\"ltr\">Cases related to money laundering by public servants are investigated and prosecuted by the ED and Financial Intelligence Unit.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Comptroller and Auditor General of India (CAG)</p>\n</td>\n<td>\n<p dir=\"ltr\">Supreme audit institution which assist in identifying areas of financial mismanagement, corruption, or fraud.&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Election Commission of India (ECI)</p>\n</td>\n<td>\n<p dir=\"ltr\">Issues Model Code of Conduct before every election, regulates political parties, prescribes limits of campaign expenditure by candidates and parties and monitors the spending.</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Legal framework</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Prevention of Corruption (Amendment) Act (PCA), 2018</p>\n</td>\n<td>\n<p dir=\"ltr\">Provides that any public servant who accepts or attempts to accept from any person any undue advantage in lieu of performance of a public duty shall be punishable with imprisonment for a minimum term of 3 years and maximum of 7 years.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Fugitive Economic Offenders Act, 2018</p>\n</td>\n<td>\n<p dir=\"ltr\">Covers cases of benami transactions, corporate fraud, evasion of income tax, PCA and PMLA, etc.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Whistle Blowers Protection Act 2014</p>\n</td>\n<td>\n<p dir=\"ltr\">Provide a framework to investigate alleged corruption and misuse of power by public servants and to protect persons who allege any wrongdoings.&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Companies Act, 2013</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Provides for corporate governance and prevention of corruption and fraud in the corporate sector.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Serious Fraud Investigation Office (SFIO), was established under the act for detecting and prosecuting white-collar crimes/frauds.</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Foreign Contribution Regulation Act (FCRA), 2010</p>\n</td>\n<td>\n<p dir=\"ltr\">To prohibit the foreign dealings and regulating the foreign contributions in the country.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Right to Information (RTI) Act, 2005</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Provides for the smoother and greater access to information to Indian citizens through a citizen-centric approach.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Scams relating to Commonwealth Games were unearthed by an RTI applicant.</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Prevention of Money Laundering Act (PMLA) 2002</p>\n</td>\n<td>\n<p dir=\"ltr\">It aims to prevent money-laundering and provide for confiscation of property derived from money-laundering.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Indian Penal Code (IPC), 1860</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Section 169 pertains to a public servant unlawfully buying or bidding for property.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Section 409 pertains to criminal breach of trust by a public servant.&nbsp;</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Supreme Court verdict</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Struck down section 6A of Delhi Special Police Establishment (DSPE) Act 1946.</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">DSPE Act was brought into force to investigate cases of bribery and corruption by Central Government employees.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Section 6A of DSPE Act (inserted in 2003) required CBI to obtain approval of the Centre to proceed in corruption cases against officers of the rank of joint secretary and above.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">This provision was struck down as unconstitutional by SC in Subramanian Swamy v. Union of India case (2014).</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Recently, Supreme Court ruled that its 2014 decision applies retrospectively from 2003 thus removing the immunity to central government employees.</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Digitalisation Initiatives&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Digital India Programme, MeitY</p>\n</td>\n<td>\n<p dir=\"ltr\">Under it, initiatives like DigiLocker, e-Hospital, e-Sign, MyGov, Digital Village etc. have helped in delivery of substantial services directly to the beneficiary in a transparent and corruption free manner.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Government E-Marketplace (GeM), Ministry of Commerce and Industry</p>\n</td>\n<td>\n<p dir=\"ltr\">It enables government for online procurement of goods and services thereby ensuring transparency and reduced corruption risk through API-integrated user authentication.</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Innovative initiatives by Civil Society Organisations</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">&lsquo;I Paid a Bribe&rsquo; online platform</p>\n</td>\n<td>\n<p dir=\"ltr\">It is a citizen driven mechanism created by Janaagraha for tracking bribe payment activity, as also instances of when people resisted bribe payments or did not have to pay bribes because of good government systems.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Zero Rupee Note</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">It was created by 5th Pillar (Tamil Nadu-based NGO) to raise awareness about bribery and reminding the public of their rights and alternative solutions that are available.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Notes are identical to Indian banknotes but carry the slogan, &ldquo;Eliminate corruption at all levels&rdquo;.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong><br><br></strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 3.1. Technology: Tool to enhance Anti-corruption Efforts</p>\n<p dir=\"ltr\">In the area of anti-corruption, technology &ndash; from ICTs to new technologies &ndash; has become one of the greatest allies. Digital technologies could contribute to preventing and tackling corruption, both directly via Digital tools to detect, analyse, investigate, predict, and monitor corruption and indirectly via Access to information (e.g. open data for monitoring),&nbsp;</p>\n<br>\n<p dir=\"ltr\"><img src=\"https://lh7-us.googleusercontent.com/JyCNWq-HppNAMI3KBfMWobSxqu0IE7yEDceoDEJKgrJmuI7O_3SB849xdeCCtrvcPZ3x6TYoHRWYAtMNGMnldgk3aXay98NxhFHigj9InH-9nw_wRkhd9k2bQss1UbdKjqzhe1alFGM03n9nXBVyfg\" width=\"491\" height=\"376\"></p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<ol>\n<li dir=\"ltr\" aria-level=\"2\">\n<h2 dir=\"ltr\" role=\"presentation\">What measures have been taken at the global level to combat corruption?</h2>\n</li>\n</ol>\n<p><strong><br><br></strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"206\"><col width=\"520\"></colgroup>\n<tbody>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Table 3.2. Measures taken globally to combat corruption</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">United Nations Convention against Corruption (UNCAC)</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The only legally binding universal anti-corruption instrument. India ratified UNCAC in 2011.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Convention covers five main areas i.e preventive measures, criminalization and law enforcement, international cooperation, asset recovery, and technical assistance and information exchange.</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">OECD Anti-Bribery Convention</p>\n</td>\n<td>\n<p dir=\"ltr\">First and only international anti-corruption instrument focused on the &ldquo;supply side&rdquo; of the bribery transaction &ndash; the person or entity offering, promising or giving a bribe.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">International Anti- Corruption Day (IACD)</p>\n</td>\n<td>\n<p dir=\"ltr\">IACD is observed annually on December 9 to raise public awareness on the malpractice of corruption and its harmful effects on progress and development.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">G20 Anti-Corruption Working Group (ACWG)</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Under India&rsquo;s G20 presidency, G 20 members reaffirm commitment to zero tolerance for corruption and endorse three G20 High-Level Principles on</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Strengthening Law Enforcement and Information Sharing for Combating Corruption.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Strengthening Asset Recovery Mechanisms for Combating Corruption.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Promoting Integrity and Effectiveness of Public Bodies and Authorities responsible for Preventing and Combating Corruption.</p>\n</li>\n</ul>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Financial Action Task Force (FATF)</p>\n</td>\n<td>\n<p dir=\"ltr\">To aid the fight against corruption through strengthening FATF Standards on beneficial ownership, to prevent the corrupt from hiding funds.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">World Banks&rsquo;s Worldwide Governance Indicators (WGI)</p>\n</td>\n<td>\n<p dir=\"ltr\">To help analysts assess broad patterns in perceptions of governance across countries and over time.</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">It provides a ranking for over 200 countries territories based on six dimensions of governance including &lsquo;Voice and Accountability&rsquo;; &lsquo;Regulatory Quality&rsquo;; and &lsquo;Control of Corruption.&rsquo;</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Sustainable Development Goals (SDGs)</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">SDG 16 (Peace, Justice and Strong Institutions) acknowledges the importance of anti-corruption as an institutional principle.</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Other innovative initiatives&nbsp;</p>\n</td>\n<td>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Australia: Australia\'s Integrity Commission seeks to unify the country\'s various federal integrity agencies under one umbrella.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Indonesia: Initiative called \'I am a woman against corruption\' through which over 2,000 women have been trained to be anti-corruption champions and then become internal reformers within their agencies.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong><br><br></strong></p>\n<ol start=\"4\">\n<li dir=\"ltr\" aria-level=\"1\">\n<h1 dir=\"ltr\" role=\"presentation\">What hinders India\'s efforts to combat corruption effectively?</h1>\n</li>\n</ol>\n<p dir=\"ltr\">India&rsquo;s recent economic successes have been unable to reduce the systemic corruption amongst the country&rsquo;s corporate, bureaucratic and political class due to multiple challenges. These include:</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Delayed investigation: Specialised agencies investigating corruption charges tend to take longer time due to technical nature of crimes, such as financial fraud. Also, gathering and analysing large volumes of documentation is time consuming leading to delays in filing of charge sheet.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of Coordination: Multiple agencies including the CBI, state anti-corruption bureaus, and vigilance departments, often have overlapping jurisdiction. This can lead to inefficiencies and delays in corruption investigations.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of Technical expertise: To investigate highly technical nature of fraudulent transactions agencies need adequate technical support, such as auditors, lawyers, scientists, to discern the nature of the transaction and whether there is any violation of law.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Overburdened Judiciary: Indian judiciary is overburdened with almost 3 crore pending cases, also the process is long drawn and complicated.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">As per annual report of CVC, nearly 6,841 corruption cases probed by the CBI were pending trials in different courts, 313 of them are pending for more than 20 years.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Implementation Issues: Corruption cases involving high-ranking officials can influence the outcome of cases. The lack of political will to tackle corruption has led to a weak implementation of the law, with many corrupt officials going unpunished.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of coordination in internal audit: It leads to ineffective use of limited resources, variation in reports and limit the oversight. Lack of independent audits and involvement of NGOs also raises question on the authenticity of the report.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Vacancy and Performance: Lokpal and Lokayuktas Act, 2013 provided for establishing a body i.e. the Lokpal to be headed by a Chairperson. However, the first chairperson was appointed in 2019, making the body defunct for nearly 6 years.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Also, performance of the Anti-corruption ombudsman Lokpal has been questioned as it has not prosecuted a single person accused of graft to date.</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 4.1. In Conversation! Lobbying and Corruption in India</p>\n<br>\n<p dir=\"ltr\">Vini: Hey Vinay, I was reading about lobbying and corruption in India. It\'s quite a complex issue, isn\'t it?</p>\n<p dir=\"ltr\">Vinay: Absolutely, Vini. Lobbying can play a legitimate role in democracy, as it provides governments with valuable policy-related information and expertise. But it becomes problematic when it blurs the lines with corruption.&nbsp;</p>\n<p dir=\"ltr\">Vini: I agree. India currently doesn\'t have a law to regulate lobbying. But recent corruption scandals in India involving lobbying by big businesses have increased public pressure for a law to regulate the activity.</p>\n<p dir=\"ltr\">Vinay: Yes. Did you know, some countries like the US, Canada, and Australia regulate lobbying to enhance transparency. They see it as a legitimate right of citizens to influence policymakers.&nbsp;</p>\n<p dir=\"ltr\">Vini: I believe the challenge is defining what constitutes lobbying without legitimizing corrupt practices.</p>\n<p dir=\"ltr\">Vinay: Indeed. Universal access to information on lobbying expenses and policymakers\' interactions can be a significant step toward a more transparent and participative democracy.</p>\n<p dir=\"ltr\">Vini: True, it\'s about striking the right balance between influence and integrity in policymaking.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<ol start=\"5\">\n<li dir=\"ltr\" aria-level=\"1\">\n<h1 dir=\"ltr\" role=\"presentation\">In what ways can India strengthen its fight against corruption?</h1>\n</li>\n</ol>\n<p dir=\"ltr\">The last two decades have witnessed an unprecedented anticorruption activity, however, further steps are needed to address the issue of corruption in India. These include-</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Institutional Measures</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Strengthening law enforcement agencies: Government should provide adequate resources and capacity building to law enforcement agencies and strengthening the independence of judiciary.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Strengthening Media: Strengthening regulatory framework such as Press Council of India, promoting self-regulation and developing mechanisms to hold media accountable for spreading false information.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">ARC recommendations:</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Anti-Corruption Bureaus should be brought under the control of the State Vigilance Commission.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The economic offences unit of states need to be strengthened to effectively investigate cases and there should be better coordination amongst existing agencies.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Development of a code of ethics for public officials and employees to promote ethical behaviour.</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Policy Measures</p>\n</li>\n</ul>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"274\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 5.1. NACS Strategic pillars</p>\n<br><img src=\"https://lh7-us.googleusercontent.com/Ja9bhw-yy5NSvtGpyk9OmFCGPlS0JgqCk5BeXRRczL0EcKwiirBQfzqjiAVBoquOU7R2r8kLmhNIHHZ8dIv_0tEBQfd5NHlsXAfhQ7RecP6DTuKwV56Sg_IDS6BVZUdsGPRFicohxk8T9chU2aor9A\" alt=\"A close-up of a diagram\n\nDescription automatically generated\" width=\"246\" height=\"339.09546768665314\"></td>\n</tr>\n</tbody>\n</table>\n</div>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Governance: India needs to clamp down on corporate secrecy, foreign bribery and complicit professional enablers, such as bankers and lawyers.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">National Anti-Corruption Strategy (NACS) can be formulated on the lines of South Africa to improve the governance and tackle corruption cases effectively.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Engaging stakeholders:&nbsp; A broad-based action, trust, and commitment should be built by mobilising stakeholder and coordinating actions of government institutions, public servants, citizens and the business community.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Transparency: Ensure the public receives accessible, timely and meaningful information, including on public spending and resource distribution.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Economic Measures</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Political Financing Reforms: There is an urgent need to regulate political party financing to increase transparency, capping campaign expenditure and disclose funding sources.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">State funding of elections can be explored to address the increased use of money and muscle power in the elections.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">International collaboration: There is need to enhance global efforts to seize, confiscate and return criminal proceeds to victims and states, in line with international obligations and domestic legal frameworks, including through support to the FATF and operationalization of the GlobE (Global Operational Network of Anti-Corruption Law Enforcement Authorities) Network.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Social Measures</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Public engagement: Encourage public by creating awareness campaigns and providing protection to whistle blowers.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Policies and resources should be determined by fair and public processes.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Measures such as establishing mandatory public registers of lobbyists, enabling public scrutiny of lobbying interactions and enforcing strong conflict of interest regulations are essential.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Education and Awareness: Integrating digital education and literacy into school curriculum along with promoting ethical values like honesty, integrity etc. from an early age.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Women empowerment: More women representatives in positions of power can lead to break apart entrenched networks of invisible forms of corruption like sexual bribery, and improve delivery of public and social services etc.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Women\'s Reservation Bill 2023 is a step in the right direction.</p>\n</li>\n</ul>\n<h1 dir=\"ltr\">Conclusion&nbsp;</h1>\n<p dir=\"ltr\">Corruption remains a complex and multifaceted challenge in India, affecting every aspect of society and governance. It may not be possible to root out corruption completely at all levels but it is possible to contain it within tolerable limits. A multi-faceted approach addressing the root causes, fostering transparency, and promoting a culture of integrity are pivotal in creating a corruption-free society as India aims to emerge as a responsible global actor.</p>\n<p><strong><br><br></strong></p>\n<h1 dir=\"ltr\">Topic at a Glance</h1>\n<p dir=\"ltr\">Countering Corruption: India&rsquo;s Ongoing Battle</p>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Corruption is defined as misuse of public position or power for personal gains. As per UNDP, Corruption = (monopoly + discretion) &minus; (accountability + integrity + transparency). As per Corruption Perceptions Index 2022, India ranks at 85th among 180 countries.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Root causes that sustain corruption in India</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Institutional Factors</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Systemic issues like official secrecy and lack of strong public forum to oppose corruption.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">In elections to meet high cost of election and to seek personal favour.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of Independent agency to investigate corruption cases.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Norms and Values: Lack of emphasis on value education and Social acceptance to corruption.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Collective action problem: Low remuneration and Competition in market with respect to power, position, jobs, and education.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Functional issues such as Poor implementation of legal framework and policies and Lack of access to information.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Implications of corruption for India\'s development and progress</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Economic cost: Corruption promotes inefficiencies in resources utilisation, distorts markets, and discourage foreign and domestic investments.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Social cost: Corruption erodes public trust, Hinders access to essential services, Hampers freedom of speech, Affects women through gender-specific forms like sexual bribery.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Political cost: Corruption undermines principles of democracy, distorts political processes, and influences election outcomes.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Environmental cost: Corruption encourages illegal environmental activities like poaching, illegal logging, or toxic waste dumping.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Implications for National Security: Corruption supports the ongoing existence of organized crime and creates conflict conditions.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">India&rsquo;s efforts to prevent and combat corruption</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Regulatory framework: Lokpal and Lokayuktas Act, 2013, CVC; CBI; ECI; Directorate of Enforcement (ED); CAG.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Legal framework: Prevention of Corruption (Amendment) Act, Fugitive Economic Offenders Act, Whistle Blowers Protection Act, Companies Act, Foreign Contribution Regulation Act (FCRA), Right to Information (RTI) Act, Prevention of Money Laundering Act (PMLA), Indian Penal Code (IPC).</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Supreme Court struck down section 6A of Delhi Special Police Establishment (DSPE) Act 1946.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Digitalisation Initiatives: Digital India Programme by MeitY; Government E-Marketplace (GeM) by Ministry of Commerce and Industry etc.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">CSO initiatives: &lsquo;I Paid a Bribe&rsquo; online platform; Zero Rupee Note etc.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Challenges in India\'s efforts to combat corruption&nbsp;</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Delayed investigation due to technical nature of crimes.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of Coordination among agencies and Lack of Technical expertise.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Overburdened Judiciary: 3 crore pending cases.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of political will led to weak implementation of law.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Vacancy and poor performance: First chairperson for Lokpal appointed in 2019, making Lokpal defunct for nearly 6 years.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"667\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Way forward</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Strengthening law enforcement agencies and media.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Anti-Corruption Bureaus under control of State Vigilance Commission.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Engaging stakeholders and coordinating actions of government institutions, public servants, citizens and business community.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Regulate political party financing to increase transparency, capping campaign expenditure and disclose funding sources.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Enhance global efforts to seize, confiscate and return criminal proceeds to victims and states, in line with international obligations.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Integrating digital education and literacy into school curriculum along with promoting ethical values.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">More women representatives in positions of power.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p>&nbsp;</p>','2024-01-02 14:43:50','2024-01-02 14:49:44'),(7,7,'<p class=\"MsoNormal\" style=\"text-align: justify; margin: 6.0pt 0cm 6.0pt 0cm;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin;\">Seventh Schedule</span></strong></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--> <span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">It is constituted under <strong style=\"mso-bidi-font-weight: normal;\">Article 246.</strong> </span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-IN;\">It <strong style=\"mso-bidi-font-weight: normal;\">specifies the distribution of powers and responsibilities between the states and the centre</strong>, as enumerated in three lists.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level2 lfo1;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-IN;\">U</span></strong><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">nion list</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"> consisting of <strong style=\"mso-bidi-font-weight: normal;\">97 entries.</strong></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level2 lfo1;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">State list</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"> consisting of <strong style=\"mso-bidi-font-weight: normal;\">66 entries</strong>.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level2 lfo1;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Concurrent list</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\"> consisting of <strong style=\"mso-bidi-font-weight: normal;\">47 entries</strong></span><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-IN;\">Article 248 </span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-fareast-language: EN-IN;\">confers residuary powers on the Parliament.</span><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> </span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level2 lfo1;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Residuary powers</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> refer to the power of jurisdiction upon subjects that are not mentioned in the state or concurrent list.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Procedure for amending Seventh schedule</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> </span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level2 lfo1;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">It can be amended as provided under <strong>Article 368 of Constitution. </strong></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level2 lfo1;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">It <strong>requires special majority of the Parliament</strong> (majority of the total membership of the House and by a majority of not less than two-thirds of the members of the House present and voting) and also the consent of half of the state legislatures by a simple majority.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; margin: 6.0pt 0cm 6.0pt 0cm;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\';\">Rationale for emphasis on Strong centre in Indian Federal Setup</span></strong></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">The Partition Episode:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> There was an imminent need for a strong Centre and the choice was made in light of partition to secure the unity of India against separatists tendencies in the future.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">The Princely States problem:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> The princely states accounted for 40% of the territory and 30% of the overall population of the sub-continent and merging them all, into a single entity needs a Strong Centre.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">To enable balanced growth:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> At the time of independence, </span><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Segoe UI\';\">India was among the poorest nations in the world, which prompted the need for the collective utilization of the country\'s resources.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">The diversity of the country:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> As per the Constituent Assembly, the diverse nature of the country needed a common approach in many aspects to unify the regions better. </span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l1 level1 lfo1; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">National security and defense</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">: A strong center is necessary to ensure that the country\'s borders are secure and that the armed forces are able to defend the nation against external threats.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; margin: 6.0pt 0cm 6.0pt 0cm;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\';\">Concerns with the current seventh schedule:</span></strong></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l2 level1 lfo2; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Unachieved Balance of Growth:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> While the Centre was made powerful to make the required balance in development of states, <strong style=\"mso-bidi-font-weight: normal;\">there is a clear demarcation existing between states in terms of growth and human indicators even after 75 years of independence.</strong></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l2 level1 lfo2; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Demotes cultural autonomy of the states:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> The Unity in diversity was hailed as a distinct feature of the country, <strong style=\"mso-bidi-font-weight: normal;\">several states have claimed that their unique features and traditions are at stake, due to excessive interference from the centre</strong>.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l2 level1 lfo2; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Misplaced entries in the list:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> Several entries were transferred from the States list to the concurrent list like Education and are yet to be provide a significant reason for its transfer and the States continue to be the sole provider of the Primary and Secondary education in most cases.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l2 level1 lfo2; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Union legislations on State subjects:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> The Union Government has made many legislations like The Mahatma Gandhi National Rural Employment Guarantee Act, 2005, National Food Security Act, 2013, Gram Nyayalayas Act, 2008 etc.. which have references to entries in the states list.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; margin: 6.0pt 0cm 6.0pt 0cm;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\';\">Way forward</span></strong></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo3; margin: 0cm 0cm .0001pt 18.0pt;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">As per the Sarkaria Commission&rsquo;s recommendations:</span></strong></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level2 lfo3;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Residuary powers should be transferred to concurrent list</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> than with Centre.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level2 lfo3;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">States should be consulted before the union government exercises powers</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> under the concurrent list.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level2 lfo3;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: \'Courier New\'; mso-fareast-font-family: \'Courier New\';\"><span style=\"mso-list: Ignore;\">o<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">When making laws on concurrent subjects, <strong>the union should legislate with a light touch</strong> i.e. as is necessary to ensure uniformity in basic issues of national policy, while leaving the details for state governments.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 18.0pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo3;\"><!-- [if !supportLists]--><span lang=\"EN-US\" style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\">Consultation with states through Inter-State Council:</span></strong><span lang=\"EN-US\" style=\"mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin;\"> As per the <strong style=\"mso-bidi-font-weight: normal;\">Venkatachaliah Commission&rsquo;s recommendation</strong>, individual and collective consultation with the states should be undertaken through the <strong style=\"mso-bidi-font-weight: normal;\">Inter-State Council over legislations in Concurrent lists.</strong></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; margin: 6.0pt 0cm 6.0pt 0cm;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 10.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Reinvigoration of forums for consultation: Forums for consultation between union and state governments like the Zonal Councils need to be reinvigorated </span></strong><span lang=\"EN-US\" style=\"font-size: 10.0pt; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Times New Roman\'; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">and be used as a podium for effective discussion.</span></p>','2024-01-03 04:32:25','2024-01-03 04:37:05'),(8,8,'<h2 dir=\"ltr\">Introduction</h2>\n<p dir=\"ltr\">The global shift towards sustainable energy has reached a critical juncture. While the period 2010-2021 saw remarkable cost reductions for solar and wind power technologies, scaling up technologies like green hydrogen, energy storage, and offshore wind is imperative for the next stage of the energy transition. However, access to funding in many emerging and low-income economies is not sufficient, and often too costly to accelerate the energy transition at the necessary rate. This underscores the critical role of affordable finance in ensuring the success of this transition as well as in meeting global climate goals.&nbsp;</p>\n<p><strong>&nbsp;</strong></p>\n<h2 dir=\"ltr\">1. What do we understand by Energy transition?</h2>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">It refers to the global energy sector&rsquo;s shift from fossil-based systems of energy production and consumption-including oil, natural gas and coal- to renewable energy sources like wind and solar, as well as lithium-ion batteries.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The primary goal of energy transition is to reduce carbon emissions and promote sustainability. It is therefore a crucial enabler of sustainable development and climate resilience.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Global energy transition demands a substantial infusion of financial resources to drive innovation, infrastructure development, and global climate action.</p>\n</li>\n</ul>\n<ol>\n<li dir=\"ltr\" aria-level=\"2\">\n<h3 dir=\"ltr\" role=\"presentation\">What factors underscore the necessity of a global shift in energy sources and systems?</h3>\n</li>\n</ol>\n<p dir=\"ltr\">The need for energy transition to sustainable sources arises from several pressing challenges and imperatives that humanity faces today. These include:&nbsp;</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Climate Change Mitigation: Transitioning to low-carbon energy sources is essential to limit global warming to safe levels and mitigate its adverse effects.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Global Commitments: Energy sector accounts for approximately 65% of total global GHG emissions. These need to be reduced dramatically, and eventually eliminated, to meet the goals of the Paris Agreement to limit the global temperature rise to within 1.5&deg;C.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Energy Security: Transitioning to domestic and renewable energy sources enhances energy security by reducing dependence on fossil fuel imports.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Depletion of Non-Renewable Resources: Transitioning to renewable energy sources, which are essentially inexhaustible, helps mitigate resource depletion concerns.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Hedge against fossil fuel price volatility: Renewables, once installed, provide multi-decadal energy independence and, thus, minimise the effect of instability of international energy markets.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Need for energy transition in India:&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Sector-wise, electricity generation is a major contributor in India&rsquo;s Greenhouse Gases (GHG) emissions (contributing around 34 % in total emissions in 2019).</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">In order to fulfil its Nationally determined contributions (NDCs) and Panchamrita Pledge, such as- achieving 50% energy from non-fossil fuel resources by 2030, net-zero emissions by 2070, etc.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">To reduce its dependency on energy imports to overcome issues related to energy supply chain volatilities.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Spending on more efficient appliances, electric and fuel cell vehicles, building retrofits and energyefficient construction provide further employment opportunities.</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"601\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 1.1. &lsquo;Just&rsquo; Energy Transition</p>\n<p dir=\"ltr\">Just Energy Transition puts people at the centre of the energy transition. International Labour Organization (ILO) defines Just Energy Transition as &ldquo;Greening the economy in a way that is as fair and inclusive as possible to everyone concerned, creating decent work opportunities and leaving no one behind&rdquo;.</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Just Energy Transition seeks to strike a balance between environmental goals and social equity by ensuring that vulnerable and disadvantaged communities are not disproportionately affected by the changes.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"174\"><col width=\"19\"><col width=\"111\"><col width=\"75\"><col width=\"64\"><col width=\"161\"></colgroup>\n<tbody>\n<tr>\n<td colspan=\"6\">\n<p dir=\"ltr\">Figure 1.1. Global Energy Transition Trends (infographic)&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"6\">\n<p dir=\"ltr\">Globally</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Renewables make up around 30% of electricity generation.</p>\n</td>\n<td colspan=\"2\">\n<p dir=\"ltr\">300 GW</p>\n<p dir=\"ltr\">of renewables were added in 2022 accounting for 83% of new capacity.</p>\n</td>\n<td colspan=\"2\">\n<p dir=\"ltr\">88% and 68%</p>\n<p dir=\"ltr\">cost reductions for solar PV and onshore wind respectively.</p>\n</td>\n<td>\n<p dir=\"ltr\">USD 1.3 trillion investments across all energy transition technologies in 2022 (a record high).</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"3\">\n<p dir=\"ltr\">Targeted share of renewables in the global energy mix &ndash;</p>\n<p dir=\"ltr\">&nbsp;77% by 2050 (1000 GW).</p>\n</td>\n<td colspan=\"3\">\n<p dir=\"ltr\">Financing targets:&nbsp;</p>\n<p dir=\"ltr\">USD 150 trillion, approx. 4.4 trillion annually.&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"6\">\n<p dir=\"ltr\">The good news is that&nbsp;global investment in clean energy is rising, according to the International Energy Agency (IEA).&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"6\">\n<p dir=\"ltr\">Case in India</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Renewables made up around 20% of electricity generation, 180 GW of installed capacity.</p>\n</td>\n<td colspan=\"2\">\n<p dir=\"ltr\">Targeted share of renewables in the energy mix-&nbsp;</p>\n<p dir=\"ltr\">50% by 2030, 500 GW of installed capacity.</p>\n</td>\n<td colspan=\"2\">\n<p dir=\"ltr\">Financing targets:&nbsp;</p>\n<p dir=\"ltr\">USD 28 billion will be required annually from 2022 to 2029.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong><br><br><br><br><br><br><br></strong></p>\n<ol start=\"2\">\n<li dir=\"ltr\" aria-level=\"2\">\n<h3 dir=\"ltr\" role=\"presentation\">What are the available technological avenues for energy transition?</h3>\n</li>\n</ol>\n<p><strong>&nbsp;</strong></p>\n<p dir=\"ltr\">Technological avenues for energy transition encompass a range of innovations and solutions for balancing intermittency and increasing the efficiency of renewable power systems. These include:</p>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"160\"><col width=\"441\"></colgroup>\n<tbody>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Table 1.1. Technological avenues that support energy transition (add relevant icons)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Energy conservation and efficiency solutions</p>\n</td>\n<td>\n<p dir=\"ltr\">These include upgrades, retrofits, repairs and replacements of end-use appliances and other circular economy practices.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Renewable energy technologies</p>\n</td>\n<td>\n<p dir=\"ltr\">These include Solar Photovoltaic (PV) Panels, Wind Turbines, Hydroelectric Power, Biomass Energy and Geothermal Energy.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Electricity storage technologies&nbsp;</p>\n</td>\n<td>\n<p dir=\"ltr\">These include battery technologies like lithium-ion batteries, Redox-flow batteries&nbsp;(RFBs), Liquid metal batteries etc.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Development of Hydrogen&nbsp;</p>\n</td>\n<td>\n<p dir=\"ltr\">This include grey, blue and green hydrogen to decarbonize economic sectors which are hard to electrify, such as cement, steel, long-haul transport etc.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Carbon Capture, Utilization, and Storage (CCUS) technologies</p>\n</td>\n<td>\n<p dir=\"ltr\">This includes Direct Air Capture (DAC) i.e. Capturing CO2&nbsp;directly from the air and Bioenergy with carbon capture and storage (BECCS) i.e. Capturing CO2&nbsp;from the combustion of plant-based biofuels.&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Digital technologies</p>\n</td>\n<td>\n<p dir=\"ltr\">This includes Smart grids and Smart meters, that can help integrate higher shares of renewables and better match supply and demand.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<ol start=\"2\">\n<li dir=\"ltr\" aria-level=\"1\">\n<h2 dir=\"ltr\" role=\"presentation\">What are the barriers to financing the transition towards renewable energy in Developing and Emerging economies?</h2>\n</li>\n</ol>\n<p><strong>&nbsp;</strong></p>\n<p dir=\"ltr\">Developing and emerging economies account for two-thirds of the world&rsquo;s population and therefore play a major role in achieving the global energy transition targets. However, these countries account for only one-fifth of investment in clean energy. Major barriers in access to finance in these countries are:&nbsp;</p>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">High Capital Cost</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">High upfront capital required for solar or wind farms, acts as a barrier for many investors.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">High risk perception due to factors like political instability, regulatory uncertainties, etc. This increases the Risk Premium(additional cost of capital that investors may demand to compensate for perceived or actual risk).</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of transparency on the actual cost make it harder for investors to price risk and for policy makers to act.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">High inflation and rising interest rates, depresses rates of return, making investments in general less attractive.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Disparities across countries and technologies: Renewable energy investment remains concentrated in a limited number of countries and focused on only a few technologies.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">For instance, Africa accounted for only 1% of additional capacity in 2022. And 95% investments were channelled toward solar PV and wind power.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Over reliance on public sources of finance and limited affordability and access to private capital.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">75% of global investment in renewables from 2013 to 2020 came from the private sector, but in technologies with the least associated risks like solar PV.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Technologies like geothermal and hydropower relies primarily on public finance.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Global Uncertainties:&nbsp; COVID-19 and Ensuing price spikes amid Russia&rsquo;s- Ukraine war have drained developing economies of their financial resources and shifted focus to maintaining secure and stable energy supply.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of supportive policy and regulatory environment: Fossil Fuel subsidies, lengthy procedures for licensing and land acquisition, restrictions on FDI, currency risks, and weaknesses in local banking and capital markets are the major issues.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Other challenges like Dependency on fossil fuel as primary source of energy, rising debt levels in most low- and middle-income countries (LICs and MICs) and Weak institutional capacities.</p>\n</li>\n</ul>\n<ol>\n<li dir=\"ltr\" aria-level=\"2\">\n<h3 dir=\"ltr\" role=\"presentation\">What are the major challenges of financing energy transition in India?</h3>\n</li>\n</ol>\n<p><strong>&nbsp;</strong></p>\n<p dir=\"ltr\">These challenges are intricately associated with the structure of the industry and investment character for the industry:</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Institutional and Policy-level Complicacies: Energy is a concurrent subject. This somehow creates a degree of uncertainty with regard to decision making power.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">This also creates market segmentation within the country, and India is not often considered as a single market by investors.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Short Tenures and High Costs of Debt Financing: High(often variable) interest rates, short debt tenures, and lack of non-recourse debt make India an expensive destination for investment.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Risks and Uncertainties: Policy and regulatory risks, technology-related risks, off-taker risks, and foreign-exchange risks are associated with renewable energy sector financing, given the nascent phase of renewable energy development in the country.</p>\n</li>\n</ul>\n<ol start=\"3\">\n<li dir=\"ltr\" aria-level=\"1\">\n<h2 dir=\"ltr\" role=\"presentation\">What are the leading initiatives in place to support the funding of the energy transition?</h2>\n</li>\n<ol>\n<li dir=\"ltr\" aria-level=\"2\">\n<h3 dir=\"ltr\" role=\"presentation\">Major initiatives at global level to finance energy transition</h3>\n</li>\n</ol>\n</ol>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Paris Agreement: It encourages financial flows from developed to developing countries towards low-carbon and climate-resilient development.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Climate Investment Funds (CIFs): The only multilateral climate fund to work exclusively with multilateral development banks (MDB) to provide financing for climate-related projects in developing countries. They include the Clean Technology Fund (CTF) and the Scaling-Up Renewable Energy Program (SREP).</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Green Climate Fund (GCF): GCF is a financial mechanism under the UNFCCC that provides funding to developing countries to support their efforts in reducing greenhouse gas emissions and adapting to climate change.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Mission Innovation(MI): A global initiative involving 24 countries and the European Union, to accelerate clean energy innovation by increasing public and private investments in research and development.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Global Energy Efficiency and Renewable Energy Fund (GEEREF) by the European Investment Bank Group. It is an innovative Fund-of-Funds catalysing private sector capital into clean energy projects in developing countries and economies in transition.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Kyoto Protocol: Introduced carbon credits,&nbsp;expressed in tons of carbon dioxide equivalent, which can be traded across borders, and the revenue realized by sale of carbon credits is generally termed as carbon finance.</p>\n</li>\n</ul>\n<ol start=\"2\">\n<li dir=\"ltr\" aria-level=\"2\">\n<h3 dir=\"ltr\" role=\"presentation\">Major initiatives by India to finance energy transition</h3>\n</li>\n</ol>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Establishment by the Ministry of New and Renewable Energy of a renewable-energy-focussed non-bank finance corporation in 1987.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Role of Indian Renewable Energy Development Agency (IREDA):&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Providing Soft Loans through various modes, such as direct lending and lending through various financial intermediaries.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Promoting emerging technologies such as&nbsp;battery energy storage systems,&nbsp;green hydrogen&nbsp;electrolysers, etc.&nbsp;through innovative financing policies.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Sovereign Green Bonds: The green bond proceeds are earmarked for financing public sector projects that will help reduce the carbon intensity of the Indian economy.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">These bonds also attract private sector investment, thereby reducing the cost of capital for green projects.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">National Clean Energy Fund (NCEF): Operational since 2011&ndash;12 to invest in entrepreneurial ventures and research in the field of clean energy technologies.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">It helps in mobilizing funds through a cess on coal of INR 400 per ton known as Clean Environment Cess (&ldquo;polluter pays&rdquo; principle).</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Recognition of Priority Sector Lending(PSL): RBI has categorized the renewable energy sector as a priority sector lending in April 2015.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Government is now also considering to include Electric Vehicle sector in PSL.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Other major steps taken by the Government:</p>\n</li>\n<ul>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Permitting Foreign Direct Investment (FDI) up to 100 % under the automatic route for renewable energy projects.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Waiver of Inter State Transmission System (ISTS) charges for inter-state sale of solar and wind power for projects to be commissioned by 30th June 2025.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Launch of Green Term Ahead Market to facilitate sale of renewable energy power through exchanges.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"2\">\n<p dir=\"ltr\" role=\"presentation\">Incentive schemes for production of green hydrogen and electrolysers under the National Green Hydrogen Mission.</p>\n</li>\n</ul>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"102\"><col width=\"540\"></colgroup>\n<tbody>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Table 3.1. Worldwide success stories for potential energy transition</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">India</p>\n</td>\n<td>\n<p dir=\"ltr\">As a result of the government&rsquo;s commitment and the above initiatives,&nbsp; India has emerged&nbsp;as&nbsp;most attractive destination&nbsp;for&nbsp;renewable&nbsp;energy&nbsp;investment(ranked third on the Renewable Energy Attractive Index in 2021) and possesses the&nbsp;fourth-largest&nbsp;solar&nbsp;and&nbsp;wind power&nbsp;base globally, experiencing rapid growth.&nbsp;</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">The key drivers behind this progress include improved technological maturity, continued innovation in technologies and business models, enhanced system integration and operational performance, increased manufacturing and assembling capacities, reduced labour costs and reduced operation and maintenance costs.&nbsp;</p>\n</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Indonesia</p>\n</td>\n<td>\n<p dir=\"ltr\">Green Sukuk Market Development : It is an innovative financial instrument under which 100% of the proceeds exclusively go to finance or refinance green projects that contribute to mitigating and adapting of climate change.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Argentina</p>\n</td>\n<td>\n<p dir=\"ltr\">RenovAr Programme: It opened a space for private sector investment and innovation, helping Argentina meet its renewable energy goals while leveraging private capital and avoiding public debt.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<ol start=\"4\">\n<li dir=\"ltr\" aria-level=\"1\">\n<h2 dir=\"ltr\" role=\"presentation\">What more needs to be done to secure low cost funding for the energy transition in developing and emerging economies?</h2>\n</li>\n</ol>\n<p><strong>&nbsp;</strong></p>\n<p dir=\"ltr\">Responsibility for fostering a strong enabling environment at all levels to propel the energy transition lies squarely with governments. Government leadership on energy transitions is translated into a supportive regulatory environment, and instruments to minimize risks, which can deliver outcomes&nbsp; including energy security, energy affordability, and jobs. This entails:</p>\n<p><strong>&nbsp;</strong></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Synergy between public and private sector: The role of the public sector including multilateral development banks (MDBs) is crucial in mitigating project risk and unlocking low-cost private sector capital for the energy transition.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Blended finance approach helps combines public and private sector funds to support sustainable energy projects.</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Targeted and scaled-up public contributions: Public funding is needed to invest in basic energy infrastructure, as well as to drive deployment in less mature technologies (especially in end uses such as heating and transport, or synthetic fuel production) and in areas where private investors seldom venture.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Effective innovation frameworks across four dimensions &ndash; enabling technologies, business models, market design and system operation- are crucial components in accelerating the deployment of new and critical energy transition technologies, reducing financing cost premiums and attracting investments.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">General business-friendly measures: These include tax policy (such as not withholding taxes on profits, and no VAT on clean power sales), allowing foreign direct investment (FDI), improved permitting processes, and foreign currency/ability to repatriate profits.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Mapping the drivers of cost of capital differences between countries and technologies to understand the reasons for these differences.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Policy incentives: Countries should provide a range of policy incentives such as certification standards for the purchase of green hydrogen, to facilitate the development and deployment of the next set of critical technologies for the energy transition.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Learning from past experiences: Countries should build upon the lessons learnt from the success of solar PV and onshore wind to accelerate the potential scale-up of these critical technologies in their own country-specific context.</p>\n</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"633\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Box 4.1. In Conversation!</p>\n<p dir=\"ltr\">Concept of blended finance</p>\n<p dir=\"ltr\">Vinay: Hey Vini, have you heard about this concept of blended finance to support sustainable energy projects? It\'s been making headlines lately.<img src=\"https://lh7-us.googleusercontent.com/Jkt0LnlrHhURQ9cc52J9I2J-FRoq11QX2atkDEVKaDN_ireIM6mSuB9yCVxFKNm498zx3eF6wqRyCXn8db9USoDU16RwC419rIDmOc2YKFLvDUsfh7_Yiu93J3Fh_lrAh_S0Z1u2DmaetNukpPFdtg\" width=\"103\" height=\"222\"></p>\n<p dir=\"ltr\">Vini: Yes, I have read that it\'s an approach that combines public and private sector funds to support sustainable energy transition. But how does it actually work?</p>\n<p dir=\"ltr\">Vinay: So, sustainable energy projects often require significant upfront investments, and they might not always offer immediate returns. Public funds can help de-risk these investments, making them more attractive to private investors.</p>\n<p dir=\"ltr\">Vini: Oh, I see. So, it\'s like a partnership between governments and businesses?<img src=\"https://lh7-us.googleusercontent.com/6B-2bcTazSWFy0OPiedJ7dYSJ-Kz5G1m82ekIN3-1NnwAXa6xaZUCXVqIVMWrmZwBN7a5tydeyI59_qgeMfR-R2g7pDfkP71T3acjesxlZCdENded6-EOK-bUXHuz_EOQV97G02ufEmk_NEhnEKaUw\" width=\"86\" height=\"205\"></p>\n<p dir=\"ltr\">Vinay: Exactly. Governments or international organizations provide concessional finance or guarantees, reducing the financial risk for private investors. This, in turn, encourages more private capital to flow into clean energy projects.</p>\n<p dir=\"ltr\">Vini:&nbsp; That sounds like a win-win. Is India utilising this approach?</p>\n<p dir=\"ltr\">Vinay: Yes, India collaborated with international organizations like the World Bank and the International Finance Corporation (IFC) to attract private sector investments into developing solar power.</p>\n<p dir=\"ltr\">Vini: I hope more developing countries get on board with this for a greener and more sustainable future.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<ol start=\"5\">\n<li dir=\"ltr\" aria-level=\"1\">\n<h2 dir=\"ltr\" role=\"presentation\">Conclusion</h2>\n</li>\n</ol>\n<p dir=\"ltr\">There is a growing recognition among governments, businesses and people alike of the need for urgent action to accelerate the energy transition towards a net-zero future. Despite the immense significance, gaps still remain between the current deployment of energy transition technologies and the levels needed to achieve the goal of the Paris Agreement. The financial factor acts as a major barrier and a holistic policy framework is needed to ensure the emerging technologies for the energy transition scale down their cost curve supported by new innovations.</p>\n<p><strong><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br></strong></p>\n<h2 dir=\"ltr\">Topic at a glance</h2>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"601\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Global energy transition refers to the global energy sector&rsquo;s shift from fossil-based systems of energy to renewable energy sources in order to reduce carbon emissions and promote sustainability. This requires a substantial infusion of financial resources.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"105\"><col width=\"178\"><col width=\"136\"><col width=\"194\"></colgroup>\n<tbody>\n<tr>\n<td colspan=\"2\">\n<p dir=\"ltr\">Share of renewables in the global energy mix</p>\n</td>\n<td colspan=\"2\">\n<p dir=\"ltr\">Investments in energy transition technologies</p>\n</td>\n</tr>\n<tr>\n<td>\n<p dir=\"ltr\">Present- 30%&nbsp;&nbsp;</p>\n</td>\n<td>\n<p dir=\"ltr\">Target- 77% by 2050.</p>\n</td>\n<td>\n<p dir=\"ltr\">Present- USD 1.3 trillion&nbsp;</p>\n</td>\n<td>\n<p dir=\"ltr\">Target: USD 150 trillion, approx. 4.4 trillion annually by 2050.&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td colspan=\"4\">\n<p dir=\"ltr\">Developing and emerging economies play a major role in achieving the global energy transition targets.</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"601\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Barriers to financing the energy transition&nbsp;</p>\n<br>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">High Capital Cost as a result of high risk perception, high inflation and rising interest rates.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Investment remains concentrated in a few countries and low risk technologies like solar PV.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Over reliance on public sources of finance.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Global Uncertainties like COVID-19 and price spikes amid Russia&rsquo;s- Ukraine war.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Lack of supportive policy and regulatory environment like Fossil Fuel subsidies.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Other challenges like Dependency on fossil fuel, rising debt levels of countries.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Major challenges in India include Policy-level Complicacies, High Costs of Debt Financing.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"601\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Leading initiatives to support the funding of the energy transition</p>\n<br>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"276\"><col width=\"310\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Global</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Paris Agreement encourages financial flows from developed to developing countries.&nbsp;</p>\n</li>\n</ul>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Climate Investment Funds (CIFs) provide project financing in developing countries.&nbsp;</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Green Climate Fund (GCF) under the UNFCCC provides funding to developing countries for climate change mitigation and adaption efforts.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Mission Innovation(MI) to encourage public and private investments in R&amp;D.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Global Energy Efficiency and Renewable Energy Fund (GEEREF) by the European Investment Bank Group for catalysing private sector capital.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Kyoto Protocol introduced carbon credits.</p>\n</li>\n</ul>\n</td>\n<td>\n<p dir=\"ltr\">Initiatives by India&nbsp;</p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Renewable-energy-focussed non-bank finance corporation under Ministry of New and Renewable Energy.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Soft loans and Innovative financing policies by IREDA.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Sovereign Green Bonds that attract private sector investment for green projects.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">National Clean Energy Fund (NCEF) for research in clean energy technologies.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Categorising renewable energy sector under Priority Sector Lending(PSL).</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Other major steps such as up to 100% FDI for renewable energy projects, Incentive schemes for production of green hydrogen under the National Green Hydrogen Mission etc.&nbsp;</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p><strong>&nbsp;</strong></p>\n<div dir=\"ltr\" align=\"left\">\n<table><colgroup><col width=\"601\"></colgroup>\n<tbody>\n<tr>\n<td>\n<p dir=\"ltr\">Way forward to secure low cost funding for global energy transition</p>\n<br>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Enhancing synergy between public and private sector through Blended financing approach.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Targeted and scaled-up public investments in less mature technologies.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Effective innovation frameworks to reduce financing cost premiums and attracting investments.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Business-friendly tax policy, FDI policy, improved permitting processes, etc.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Mapping the drivers of cost of capital differences between countries and technologies.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Policy incentives such as certification standards for green hydrogen.</p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\">Building upon the learnings from the success of solar PV and onshore wind.</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p>&nbsp;</p>','2024-01-09 07:01:26','2024-01-09 07:01:26');
