INSERT INTO `articles` VALUES (1,'Law Commission recommends retention of Sedition law in India','law-commission-recommends-retention-of-sedition-law-in-india','The Law Commission in its 279th report stated that Section 124A needs to be retained in the Indian Penal Code (IPC) through certain amendments.',2,0,'public','english',1,'[\"https://www.google.com/search?q=Law+Commission+recommends+retention+of+Sedition+law+in+India&sca_esv=595131700&tbm=isch&source=lnms&sa=X&ved=2ahUKEwj60YO-qb-DAxXUTWwGHW51Dj4Q_AUoAnoECAEQBA&biw=1528&bih=742&dpr=1.25#imgrc=t5Sk1r7KIuSObM\"]',6,5,1,2,10,100,588,'2024-01-04 16:42:26','2024-01-02 11:30:40','2024-01-04 11:12:26',1,NULL),(2,'Centre to recruit senior officers through lateral entry mode','centre-to-recruit-senior-officers-through-lateral-entry-mode','The Department of Personnel and Training (DoPT) has asked the Union Public Service Commission (UPSC) to induct these senior officers from the private sector.',2,0,'public','english',0,'[\"\"]',6,5,1,2,9,83,533,'2024-01-04 16:42:26','2024-01-02 13:30:32','2024-01-04 11:12:26',2,NULL),(3,'Arrest warrant of the International Criminal Court (ICC)','arrest-warrant-of-the-international-criminal-court-icc','South Africa is thinking about legal options if Russian President, the subject of a war crimes arrest warrant issued by the ICC, did attend the BRICS summit.',2,0,'public','english',1,'[\"\"]',6,NULL,1,2,2,23,150,'2024-01-04 06:43:43','2024-01-02 13:34:33','2024-01-04 02:07:44',3,NULL),(4,'India, Nepal signed pact on Infrastructure and cross-border energy','india-nepal-signed-pact-on-infrastructure-and-cross-border-energy','Both sides highlighted that the India-Nepal Treaty of Peace and Friendship of 1950 forms the basis of relations between the two countries.',2,0,'public','english',1,'[\"\"]',6,NULL,1,2,8,76,500,'2024-01-04 06:42:08','2024-01-02 13:49:08','2024-01-04 01:12:08',4,NULL),(5,'India appeals to WTO over disputed ICT tariffs on mobile phones','india-appeals-to-wto-over-disputed-ict-tariffs-on-mobile-phones','European Union, Chinese Taipei, and Japan in raised the issue that India violated its zero-tariff commitment under the Information Technology Agreement (ITA) under the multilateral trade body.',2,0,'public','english',1,'[\"\"]',6,5,1,2,2,15,91,'2024-01-04 06:33:10','2024-01-02 14:03:46','2024-01-04 01:03:10',5,NULL),(6,'Countering Corruption: India\'s Ongoing Battle','countering-corruption-indias-ongoing-battle','Corruption has been a pervasive and deeply entrenched issue in India which has prevailed from time immemorial in one form or the other. This pervasive problem touches every facet of public life and governance and poses a significant obstacle to India\'s progress, undermining its institutions, eroding trust, and hindering socio-economic development. Since Independence, India has made large strides in the fight against corruption. ',25,0,'public','english',0,'[\"\"]',6,5,3,3,3,28,172,'2024-01-04 07:16:47','2024-01-02 14:43:50','2024-01-04 01:46:47',6,NULL),(7,'THE SEVENTH SCHEDULE','the-seventh-schedule','An analysis report of the working of the Seventh Schedule was released by the Economic Advisory Council to the Prime Minister (EAC-PM).',4,0,'public','english',0,'[\"\"]',6,5,2,7,1,1,4,'2024-01-03 10:17:35','2024-01-03 04:32:25','2024-01-03 04:47:36',7,NULL),(8,'Financing Global Energy Transition','financing-global-energy-transition','The global shift towards sustainable energy has reached a critical juncture. While the period 2010-2021 saw remarkable cost reductions for solar and wind power technologies, scaling up technologies like green hydrogen, energy storage, and offshore wind is imperative for the next stage of the energy transition.',18,0,'public','english',0,'[\"https://docs.google.com/document/d/1B59OPJlEpvZ6lDu8WF8tId7sNjzIcKI0/edit#heading=h.gjdgxs\"]',6,5,3,19,3,29,174,'2024-01-09 12:37:21','2024-01-09 07:01:26','2024-01-09 07:07:21',8,NULL);
